function openNav(){body.classList.contains("open")?(body.classList.remove("open"),navOverlay.classList.remove("nav-open")):(body.classList.add("open"),navOverlay.classList.add("nav-open"))}function generateNavShape(){const e=document.getElementsByClassName("navShapeContainer")[0];var n=new Two({type:Two.Types.svg,width:58,height:58}).appendTo(e);physicsAnimation(n,"#fff",n.width/2,n.height/2,5)}const navButtonTrigger=document.getElementsByClassName("nav-button")[0],navOverlay=document.getElementsByClassName("nav-overlay")[0],body=document.getElementsByTagName("body")[0];navButtonTrigger.addEventListener("click",openNav),generateNavShape();